(1, 'Si Kancil dan Pak Tani', 'Hutan kini sedang dilanda kemarau panjang. Akibatnya, makanan di sana habis. Sungai pun mengering. Mau tidak mau, binatang di hutan harus keluar hutan untuk mencari makanan. Tak terkecuali Kancil. Ia kini kebingungan mencari makanan.', 'Kancil pun berjalan keluar hutan. Ia berusaha mencari tempat baru, berharap di sana tersedia banyak makanan. Saat sedang berjalan, tiba-tiba ia melihat ladang Petani yang dipenuhi timun yang sangat segar.', 'Melihat timun segar di depan matanya, Kancil ingin sekali melahap timun-timun itu. Seketika timbulah ide Kancil untuk mencuri timun milik Petani.', 'Tanpa pikir panjang, Kancil pun segera masuk ke dalam ladang. Di sana ia mulai memakan timun-timun tersebut, satu persatu ia lahap. Kancil sangat menyukai timun tersebut. Tanpa disadari, Kancil memakan timun-timun itu hingga perutnya kenyang. Kancil pun pulang dengan hati yang senang.', 'hari-hari berikutnya, Kancil selalu kembali mengunjungi ladang Petani. Ia memakan timun-timun milik Petani. Awalnya hanya sedikit, lama kelamaan jumlahnya pun bertambah setiap hari. Kancil selalu pulang dengan hati yang senang. ', 'Tanpa Kancil sadari, perbuatannya diketahui oleh Petani. Petani pun merasa geram akibat ulah Kancil yang telah mencuri timun dari ladangnya. Ia berniat membalas perbuatan si pencuri yang telah menganggu usahanya,', 'Petani terus berpikir dan mencari ide, hingga akhirnya ia menemukan sebuah ide. Petani mengambil bajunya yang sudah tak dipakai, caping, dan kelapa. Lalu ia menyatukan semua itu, membentuknya menjadi orang-orangan sawah. Kemudian, ia meletakkannya di ladang timun.', 'Suatu ketika Kancil yang merasa lapar pun kembali ke ladang Petani. Ia sudah tak sabar ingin segera makan timun sebanyak-banyaknya. Di perjalanan, Kancil membayangkan memakan timun yang enak dan segar.', 'Ketika sampai di depan ladang, betapa terkejutnya Kancil mendapati ada orang yang menjaga ladang Petani. Kancil yang berniat mencuri pun kemudian bersembunyi. Ia mencoba menunggu sampai orang itu pergi.', 'Waktu demi waktu berlalu, tidak terasa sudah cukup lama ia menunggu di sana. Namun, orang itu tak juga pergi dari tempatnya.Kancil yang sudah sangat lapar, akhirnya menyerah. Ia pun kembali ke rumah tanpa membawa timun.', '', 'Kemana aku harus mencari makanan? jika bertahan di hutan ini, bisa-bisa aku mati kelaparan, Dimana ya tempat yang penuh dengan makanan?', 'Mungkin tidak apa-apa, jika aku memakan sedikit timun milik Petani, Toh nanti dia akan menanamnya kembali', 'Aku tak perlu lagi kesulitan mencari makanan di hutan. Di ladang Petani, ada banyak sekali makanan', '', 'Aku harus memberi pelajaran untuk si pencuri. Tapi, bagaimana caranya?', 'Kau akan ketakutan begitu melihat orang-orangan sawah ini', 'Aku akan membuat perutku kenyang, agar tidak perlu berkali-kali kembali ke ladang ini. Kalau perlu, aku akan membawa timun-timun itu pulang untuk persediaan makanan', '', 'Wah hebat sekali Petani itu, dia terus saja menungguku sambil berdiri di sana. Kalau begini terus aku tidak bisa makan timun hari ini');

